import React, { useState, useEffect } from "react";
import Fetch from "./Api";

const Name = () => {
  const [username, setUsername] = useState("");

  useEffect(() => {
    const data = async () => {
      setUsername(await Fetch());
    };
    data();
  });

  return (
    <div>
      <h1>Username</h1>
    </div>
  );
};

export default Name;
